import React from 'react';
import './AppContainer.css';
import { Provider as ReduxProvider } from "react-redux";
import MenuBar from './Components/MenuBar/MenuBar'

function AppContainer() {
  return (
    <ReduxProvider>
      <div className="App">
        <MenuBar />
      </div>
    </ReduxProvider>
  );
}

export default AppContainer;
